import React from 'react';
import {withStyles} from "@material-ui/styles";

const styles ={
  root:{
    position:"sticky",
    width:"100vw",
    height:"100vh",
    background:"black",
    opacity:"0.5",
  }
}

function Overlay (props) {
  const {classes} =props;
  return (
    <div className={classes.root}>

    </div>
  )
}


export default withStyles(styles)(Overlay);
